import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Dashboard from "./Dashboard/Dashboard";
import { Routes, Route } from "react-router-dom";
import RegistrationForm from "./registrationForm/RegistrationForm";
import Connexion from "./login/Connexion";
import Navbar from "./Navbar/Navbar";
import Users from "./Components/Users/Users";
import Villes from "./Components/Villes/Villes";


function App() {
  return (
    <div className="App">


      <Routes>
        <Route path="/inscription" element={<RegistrationForm />} />
        <Route path="/login/connexion" element={<Connexion />} />
         <Route path="/dashboard" element={<Dashboard />} />


         <Route path="/users" element={<Users />} />
          <Route path="/cities" element={<Villes />} />
          <Route path="/regions" element={<Regions />} />
          <Route path="/offers" element={<Offres />} />
          <Route path="/options" element={<Options />} />
          <Route path="/categories" element={<Categories />} />
      </Routes>




    </div>
  );
}

export default App;
